    useEffect(() => {
        setProducts(products)
    },[])
    
  const handleProducts = async () => {
    const url = "https://dummyjson.com/products"
    try {
        const data = await axios.get(url);
        console.log(data);
    } catch (error) {
        console.log(error);
    }
  };
  return (
    <div>
        <div className={style.container}>

        </div>
    </div>
  )
};

export default MainBody;
